import Dashboard from '../Dashboard';
import AddProduct from '../Machine/AddMachine';
import PackageList from '../Machine/MachineList';
import DeletePackage from '../Machine/DeleteMachine';
import EditPackage from '../Machine/EditMachine';

let routes = [

  {
    path: "/",
    name: "Dashboard",
    component: Dashboard,
    exact: true,
  },

  {
    path: "/package/list",
    name: "Packages",
    component: PackageList,
    exact: true,
  },

  {
    path: "/package/add",
    name: "Add Product",
    component: AddProduct,
    exact: true,
  },

  {
    path: "/package/delete/:id",
    name: "Delete Package",
    component: DeletePackage,
    exact: true,
  },
  
  {
    path: "/package/edit/:id",
    name: "Edit Package",
    component: EditPackage,
    exact: true,
  },
 
];

export default routes;
